import React from 'react'


const Table = (props)=>{
    console.log('Hey')
    console.log(props)
    props.props.TData.map((heading, index) => {
        console.log(heading)
        var result = Object.keys(heading).map(function(key) {
            return heading[key];
          });
          console.log(result)
    })
    
    return(
        <div>
            <p>GGGGG</p>
            <div className="z-depth-4">
                <table className="responsive-table centered bordered">
                    <thead>
                        <tr>
                            {
                              props.props.THead.map((th , index) => {
                                return(
                                    <th>{th}</th>
                                )
                            })  
                            }
                        </tr>
                        {
                           props.props.TData.map((data, index) => {
                            var row = Object.keys(data).map(function(key) {
                                return data[key];
                              });
                              <tbody key = {index} className = {index}>
                              <tr >
                                  <td>{row[0]}</td>
                                  <td>{row[1]}</td>
                              </tr>
                              </tbody>
                            }) 
                        }
                    </thead>
                </table>
            </div>
        <div/>
        </div>
    )
}

export default Table
